SELECT MODELS.name, MODELS.ID, COUNT(*) as pocet FROM INPUT_DATA join MODELS ON MODELS.ID = INPUT_DATA.ID_MODEL group by MODELS.name, MODELS.ID HAVING COUNT(*)<>1648 AND COUNT(*) <> 2*1648 AND COUNT(*)<>206 AND COUNT(*)<>1640 AND COUNT(*) <> 3280 ORDER BY MODELS.name;
SELECT * FROM INPUT_DATA WHERE ID_MODEL = 13189